import React, { Component } from "react";
import "./Tile.css";

class Tile extends Component {
  state = {};
  render() {
    return (
      <div className=".tile-container">
        <div>{this.props.icon}</div>
        <div>{this.props.title}</div>
        <div>{this.props.description}</div>
        <div>{this.props.link}</div>
      </div>
    );
  }
}

export default Tile;
